import React, {Component} from 'react'
import './Home.css'


export default class Home extends Component{
	render(){
		return(
				<div className='Home'> 
					  <div className="hero-image">	
					  	<img className='my-face' src='https://i.imgur.com/0FlB2Nr.jpg?1' alt='the greatest thing since sliced bread'/>			          
					  	<div className="hero-text">
				            <h1>Hi, I'm Teddy</h1>
				            <p>My passions include coding, coffee, and cats </p>
				          </div>
				      </div>
				</div>
			)
	}
}
